DE CONFORMIDAD CON EL MANUAL GENERAL DE ORGANIZACIÓN DE LA SECRETARÍA DE ADMINISTRACIÓN Y FINANZAS
-REVISAR, ANALIZAR, VERIFICAR Y EN SU CASO ELABORAR LOS CONTRATOS, CONVENIOS, ACUERDOS Y DEMÁS INSTRUMENTOS JURÍDICOS QUE
CELEBRE O SEA PARTE LA SECRETARÍA DE ADMINISTRACIÓN Y FINANZAS;
- CLASIFICAR E INSTRUMENTAR EL REGISTRO Y RESGUARDO DE LOS CONTRATOS, CONVENIOS, ACUERDOS Y DEMÁS INSTRUMENTOS JURÍDICOS
QUE CELEBRE O SEA PARTE LA SECRETARÍA DE ADMINISTRACIÓN Y FINANZAS;
- PROPORCIONAR ASESORÍA JURÍDICA A LA SECRETARÍA DE ADMINISTRACIÓN Y FINANZAS;
- ATENDER LOS PROCEDIMIENTOS, RECURSOS ADMINISTRATIVOS, CONTENCIOSOS, AMPAROS Y CUALQUIER MEDIO DE IMPUGNACIÓN, EN QUE
SEA PARTE LA SECRETARÍA DE ADMINISTRACIÓN Y FINANZAS ANTE LAS INSTANCIAS COMPETENTES Y EN LOS QUE EN SU CASO
INTERPONGAN LOS PARTICULARES; Y
- DESARROLLAR LAS DEMÁS FUNCIONES INHERENTES A SU COMPETENCIA.
